TalComponent::~TalComponent()
{
    //ImageCache::release (internalCachedBackgroundImage);
    getFilter()->removeChangeListener (this);
    deleteAllChildren();
}

FilmStripKnob* TalComponent::addNormalKnob(int x, int y, TalCore* const ownerFilter, Image knobImage, int parameter)
{
	FilmStripKnob *filmStripKnob;
	addAndMakeVisible(filmStripKnob = new FilmStripKnob(knobImage,
									 knobImage.getHeight() / knobImage.getWidth(),
									 false, parameter));
    filmStripKnob->setBounds(x, y, knobImage.getWidth(), knobImage.getWidth());
	filmStripKnob->addListener (this);
	return filmStripKnob;
}


ImageToggleButton* TalComponent::addToggleButton(int x, int y, TalCore* const ownerFilter,
	const char *imageDataOff, int imageDataOffSize, const char *imamgeDataOn, int imageDataOnSize, int parameter)
{
	Image toggleImgOff = ImageCache::getFromMemory(imageDataOff, imageDataOffSize);
	Image toggleImgOn = ImageCache::getFromMemory(imamgeDataOn, imageDataOnSize);

	ImageToggleButton *toggleButton = new ImageToggleButton("Toggle Button", toggleImgOff, toggleImgOn);
	toggleButton->setBounds(x, y, toggleImgOff.getWidth(), toggleImgOff.getHeight());
	addAndMakeVisible(toggleButton, 0);
	toggleButton->addListener (this);
	return toggleButton;
}

ImageTabButton* TalComponent::addTabButton(int x, int y, TalCore* const ownerFilter,
	const char *imageDataOff, int imageDataOffSize, const char *imamgeDataOn, int imageDataOnSize, int parameter)
{
	Image tabImgOff = ImageCache::getFromMemory(imageDataOff, imageDataOffSize);
	Image tabImgOn = ImageCache::getFromMemory(imamgeDataOn, imageDataOnSize);

	ImageTabButton *tabButton = new ImageTabButton("Tab Button", tabImgOff, tabImgOn);
	tabButton->setBounds(x, y, tabImgOff.getWidth(), tabImgOff.getHeight());
	addAndMakeVisible(tabButton, 0);
	tabButton->addListener (this);
	return tabButton;
}

//==============================================================================
void TalComponent::paint (Graphics& g)
{
    // just clear the window
    g.fillAll (Colour::greyLevel (0.2f));

    g.drawImage (internalCachedBackgroundImage,
                 0, 0, internalCachedBackgroundImage.getWidth(), internalCachedBackgroundImage.getHeight(),
                 0, 0, internalCachedBackgroundImage.getWidth(), internalCachedBackgroundImage.getHeight());
}

//==============================================================================
void TalComponent::changeListenerCallback (ChangeBroadcaster* source)
{
    // this is the filter telling us that it's changed, so we'll update our
    // display of the time, midi message, etc.
    updateParametersFromFilter();
}

void TalComponent::sliderValueChanged (Slider* caller)
{
    TalCore* const filter = getFilter();
	if (caller == inputDriveKnob) filter->setParameterNotifyingHost(INPUTDRIVE, (float)inputDriveKnob->getValue());
	if (caller == highCutKnob) filter->setParameterNotifyingHost(HIGHCUT, (float)highCutKnob->getValue());
	if (caller == cutoffKnob) filter->setParameterNotifyingHost(CUTOFF, (float)cutoffKnob->getValue());
	if (caller == wetKnob) filter->setParameterNotifyingHost(WET, (float)wetKnob->getValue());
	if (caller == dryKnob) filter->setParameterNotifyingHost(DRY, (float)dryKnob->getValue());
	if (caller == feedbackKnob) filter->setParameterNotifyingHost(FEEDBACK, (float)feedbackKnob->getValue());
	if (caller == delayTimeKnob) filter->setParameterNotifyingHost(DELAYTIME, (float)delayTimeKnob->getValue());
	setTooltip(caller);
}

void TalComponent::setTooltip(Slider* slider)
{
	if (slider == feedbackKnob)
	{
		// Set delayTime tooltip
		String text = String::formatted(T("%4.4f"),
			audioUtils.calculateFeedback((float)slider->getValue()));
		slider->setTooltip(text);
	}
	if (slider == delayTimeKnob)
	{
		// Set delayTime tooltip
		String text = String::formatted(T("%4.0f ms"), (float)delayTimeKnob->getValue() * 4000.0f);
		slider->setTooltip(text);
	}
	if (slider == inputDriveKnob
		|| slider == inputDriveKnob
		|| slider == wetKnob
		|| slider == dryKnob)
	{
		// Set dB tooltip
		String text = String::formatted(T("%4.1f dB"), audioUtils.getLogScaledValueInDecibel((float)slider->getValue(), 2.0f));
		slider->setTooltip(text);
	}
}

void TalComponent::comboBoxChanged (ComboBox* caller)
{
    TalCore* const filter = getFilter();
	if (caller == delaySyncComboBox) filter->setParameterNotifyingHost(DELAYTIMESYNC, float(delaySyncComboBox->getSelectedId()-1)/19.0f);
}

void TalComponent::buttonClicked (Button* caller)
{
    TalCore* const filter = getFilter();
	if (caller == delayTwiceLButton)
	{
		float value = caller->getToggleState() ? 1.0f : 0.0f;
		filter->setParameterNotifyingHost(DELAYTWICE_L, value);
	}
	if (caller == delayTwiceRButton)
	{
		float value = caller->getToggleState() ? 1.0f : 0.0f;
		filter->setParameterNotifyingHost(DELAYTWICE_R, value);
	}
	if (caller == tabButton)
	{
		// set new rate
		juce::int64 deltaTimeInMs = tabButton->setClick();
		if (deltaTimeInMs > (juce::int64)0 &&
			deltaTimeInMs < (juce::int64)4000)
		{
			float delayTime = (float)deltaTimeInMs / 4000.0f;
			delayTimeKnob->setValue(delayTime);
		}
	}
}

//==============================================================================
void TalComponent::updateParametersFromFilter()
{
    TalCore* const filter = getFilter();

    // we use this lock to make sure the processBlock() method isn't writing to the
    // lastMidiMessage variable while we're trying to read it, but be extra-careful to
    // only hold the lock for a minimum amount of time..
    filter->getCallbackLock().enter();

    // take a local copy of the info we need while we've got the lock..
	float inputDrive = filter->getParameter(INPUTDRIVE);
	float delayTime = filter->getParameter(DELAYTIME);
	float feedback = filter->getParameter(FEEDBACK);
	float highCut = filter->getParameter(HIGHCUT);
	float cutoff = filter->getParameter(CUTOFF);
	float wet = filter->getParameter(WET);
	float dry = filter->getParameter(DRY);

	float delayTimeTwiceL = filter->getParameter(DELAYTWICE_L);
	float delayTimeTwiceR = filter->getParameter(DELAYTWICE_R);
	float delaySync = filter->getParameter(DELAYTIMESYNC)*19.0f+1.0f;

	//float lfoSync = filter->getParameter(LFOSYNC);

    // ..release the lock ASAP
    filter->getCallbackLock().exit();

	inputDriveKnob->setValue(inputDrive, dontSendNotification);
	delayTimeKnob->setValue(delayTime, dontSendNotification);
	feedbackKnob->setValue(feedback, dontSendNotification);
	highCutKnob->setValue(highCut, dontSendNotification);
	cutoffKnob->setValue(cutoff, dontSendNotification);
	wetKnob->setValue(wet, dontSendNotification);
	dryKnob->setValue(dry, dontSendNotification);

	delayTwiceLButton->setValue(delayTimeTwiceL, dontSendNotification);
	delayTwiceRButton->setValue(delayTimeTwiceR, dontSendNotification);

	delaySyncComboBox->setSelectedId((int)delaySync, dontSendNotification);

	// update tooltips
	setTooltip(inputDriveKnob);
	setTooltip(delayTimeKnob);
	setTooltip(feedbackKnob);
	setTooltip(wetKnob);
	setTooltip(dryKnob);
}

